var usestyle = true;
var useimage = true;
var useopacity = false;

var code2keyTable={'65':'A','66':'B','67':'C','68':'D','69':'E','70':'F','71':'G','72':'H','73':'I','74':'J','75':'K','76':'L','77':'M','78':'N','79':'O','80':'P','81':'Q','82':'R','83':'S','84':'T','85':'U','86':'V','87':'W','88':'X','89':'Y','90':'Z','48':'0','49':'1','50':'2','51':'3','52':'4','53':'5','54':'6','55':'7','56':'8','57':'9','96':'Numpad 0','97':'Numpad 1','98':'Numpad 2','99':'Numpad 3','100':'Numpad 4','101':'Numpad 5','102':'Numpad 6','103':'Numpad 7','104':'Numpad 8','105':'Numpad 9','106':'Numpad *','107':'Numpad +','108':'Numpad Enter','109':'Numpad -','110':'Numpad .','111':'Numpad /','112':'F1','113':'F2','114':'F3','115':'F4','116':'F5','117':'F6','118':'F7','119':'F8','120':'F9','121':'F10','122':'F11','123':'F12','8':'BackSpace','9':'Tab','12':'Clear','13':'Enter','16':'Shift','17':'Control','18':'Alt','20':'Cape Lock','27':'Esc','32':'Spacebar','33':'Page Up','34':'Page Down','35':'End','36':'Home','37':'Left Arrow','38':'Up Arrow','39':'Right Arrow','40':'Down Arrow','45':'Insert','46':'Delete','144':'Num Lock','186':';:','187':'=+','188':',<','189':'-_','190':'.>','191':'/?','192':'`~','219':'[{','220':'\|','221':']}','222':'"'};
var setShortcutKeysAction = '';
var show_stylish_keycode, show_stylish_shift, show_stylish_ctrl, show_stylish_alt; // 顯示隱藏快速鍵
var zoom_image_keycode, zoom_image_shift, zoom_image_ctrl, zoom_image_alt; // 擴大
var opacity_keycode, opacity_shift, opacity_ctrl, opacity_alt; // 縮小

var stylishnode, imagenode, opacitynode;

GM_registerMenuCommand('show_stylish', function(){
    setShortcutKeysAction = 'show_stylish';
    showShortcutKeySettings();
});
GM_registerMenuCommand('zoom_image', function(){
    setShortcutKeysAction = 'zoom_image';
    showShortcutKeySettings();
});
GM_registerMenuCommand('opacity', function(){
    setShortcutKeysAction = 'opacity';
    showShortcutKeySettings();
});

keycodes = GM_getValue('show_stylish', 'alt+65');
array = keycodes.split('+');
show_stylish_keycode = array[array.length - 1];
show_stylish_shift = keycodes.indexOf('shift') > -1;
show_stylish_ctrl = keycodes.indexOf('ctrl') > -1;
show_stylish_alt = keycodes.indexOf('alt') > -1;

keycodes = GM_getValue('zoom_image', 'alt+67');
array = keycodes.split('+');
zoom_image_keycode = array[array.length - 1];
zoom_image_shift = keycodes.indexOf('shift') > -1;
zoom_image_ctrl = keycodes.indexOf('ctrl') > -1;
zoom_image_alt = keycodes.indexOf('alt') > -1;

keycodes = GM_getValue('opacity', 'alt+71');
array = keycodes.split('+');
opacity_keycode = array[array.length - 1];
opacity_shift = keycodes.indexOf('shift') > -1;
opacity_ctrl = keycodes.indexOf('ctrl') > -1;
opacity_alt = keycodes.indexOf('alt') > -1;

// 快速鍵設定
function showShortcutKeySettings(){
	var cover = document.getElementById('setShortcutKey');
	var message = document.getElementById('message');
	if (!cover) {
		var cover = document.createElement('div');
		cover.setAttribute('id', 'setShortcutKey');
		cover.setAttribute('style', 'display: table; background: black; color: green; text-align: center; position: fixed; top:0; left:0; width:100%; height: 100%; opacity: .9; z-index:100000;');
		var message = document.createElement('div');
		message.setAttribute('id', 'message');
		message.setAttribute('style', 'font-size: 200%; line-height: 1.5em; text-align: center; display: table-cell; vertical-align: middle; padding: 1em;');
	}
	switch (setShortcutKeysAction) {
		case 'show_stylish':
			message.innerHTML = '功能：stylish 顯示/隱藏<br />目前快速鍵：<font color="red">' + parse2keys(GM_getValue('show_stylish','alt+65')) + '</font><br />按 ESC save並退出';
			break;
		case 'zoom_image':
			message.innerHTML = '功能：zoom image 使用/不使用<br />目前快速鍵：<font color="red">' + parse2keys(GM_getValue('zoom_image','alt+67')) + '</font><br />按 ESC save並退出';
			break;
		case 'opacity':
			message.innerHTML = '功能：opacity 使用/不使用<br />目前快速鍵：<font color="red">' + parse2keys(GM_getValue('opacity','alt+71')) + '</font><br />按 ESC save並退出';
			break;
	}
    cover.appendChild(message);
    document.body.appendChild(cover);
}

// 關閉設定快速鍵
function hideShortcutKeySettings(){
    var cover = document.getElementById('setShortcutKey');
    cover.parentNode.removeChild(cover);
    setShortcutKeysAction = '';
}

// 將keycode轉換成名稱
function parse2keys(keycodes){
	var array = keycodes.split('+');
	array[array.length-1]=code2keyTable[array[array.length-1]] || '';
	return array.join('+');
}

// 設定快速鍵
window.addEventListener('keydown', function(event){
    switch (setShortcutKeysAction) {
	// 顯示/隱藏
        case 'show_stylish':
            // ESC 退出
            if (event.keyCode == 27) {
		hideShortcutKeySettings();
                break;
            }
            show_stylish_keycode = event.keyCode;
	    show_stylish_shift = event.shiftKey;
	    show_stylish_ctrl = event.ctrlKey;
	    show_stylish_alt = event.altKey;		
            var Keys = '';
            if (show_stylish_shift) {
                Keys += 'shift+';
            }
            if (show_stylish_ctrl) {
                Keys += 'ctrl+';
            }
            if (show_stylish_alt) {
                Keys += 'alt+';
            }
            var message = document.getElementById('message');
	    message.innerHTML = '功能：顯示/隱藏 stylish<br />快速鍵：<font color="red">' + Keys + (code2keyTable[show_stylish_keycode] || '') + '</font><br />按 ESC save';
	    Keys += String(event.keyCode);
            GM_setValue('show_stylish', Keys);
            break;
        case 'zoom_image':
            // ESC 退出
            if (event.keyCode == 27) {
		hideShortcutKeySettings();
                break;
            }
            zoom_image_keycode = event.keyCode;
	    zoom_image_shift = event.shiftKey;
	    zoom_image_ctrl = event.ctrlKey;
	    zoom_image_alt = event.altKey;		
            var Keys = '';
            if (zoom_image_shift) {
                Keys += 'shift+';
            }
            if (zoom_image_ctrl) {
                Keys += 'ctrl+';
            }
            if (zoom_image_alt) {
                Keys += 'alt+';
            }
            var message = document.getElementById('message');
	    message.innerHTML = '功能：image zoom 使用/不使用<br />快速鍵：<font color="red">' + Keys + (code2keyTable[zoom_image_keycode] || '') + '</font><br />按 ESC save';
	    Keys += String(event.keyCode);
            GM_setValue('zoom_image', Keys);
            break;
        case 'opacity':
            // ESC 退出
            if (event.keyCode == 27) {
		hideShortcutKeySettings();
                break;
            }
            opacity_keycode = event.keyCode;
	    opacity_shift = event.shiftKey;
	    opacity_ctrl = event.ctrlKey;
	    opacity_alt = event.altKey;		
            var Keys = '';
            if (opacity_shift) {
                Keys += 'shift+';
            }
            if (opacity_ctrl) {
                Keys += 'ctrl+';
            }
            if (opacity_alt) {
                Keys += 'alt+';
            }
            var message = document.getElementById('message');
	    message.innerHTML = '功能：opacity 使用/不使用<br />快速鍵：<font color="red">' + Keys + (code2keyTable[opacity_keycode] || '') + '</font><br />按 ESC save';
	    Keys += String(event.keyCode);
            GM_setValue('opacity', Keys);
            break;        
    }
}, true);

window.addEventListener('keyup', function(event){
    if (setShortcutKeysAction != '') return;
    // 顯示/隱藏
    if ((event.altKey == show_stylish_alt) && (event.ctrlKey == show_stylish_ctrl) && (event.shiftKey == show_stylish_shift) && (event.keyCode == show_stylish_keycode))
    {
    	usestylish = GM_getValue('stylish','true');
        if (usestylish=="true") {
            GM_setValue('stylish','false');
	    browser();
	    location.reload();
        }
        else {
            GM_setValue('stylish','true');
            browser();
        }
        //alert(useopacity);
    } 
    if ((event.altKey == zoom_image_alt) && (event.ctrlKey == zoom_image_ctrl) && (event.shiftKey == zoom_image_shift) && (event.keyCode == zoom_image_keycode))
    {
    	useimage = GM_getValue('imagestyle','true');
        if (useimage=="true") {
            GM_setValue('imagestyle','false');
            browser();
	    location.reload();
        }
        else {
            GM_setValue('imagestyle','true');
            browser();
        }
        //alert(useopacity);
    } 
    if ((event.altKey == opacity_alt) && (event.ctrlKey == opacity_ctrl) && (event.shiftKey == opacity_shift) && (event.keyCode == opacity_keycode))
    {
    	useopacity = GM_getValue('opacitystyle','false');
        if (useopacity=="true") {
            GM_setValue('opacitystyle','false');
            browser();
	    location.reload();
        }
        else {
            GM_setValue('opacitystyle','true');
            browser();
        }
        //alert(useopacity);
    } 
}, true);


